u043e\u043b\u044b\u0439 \u0431\u0440\u0430\u043a, \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043d\u044b\u0439 \u0432 \u0434\u0440\u0443\u0433\u0438\u0445 \u0448\u0442\u0430\u0442\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1998\" class=\"mw-redirect\" title=\"1998\">1998<\/a>&#160;\u2014 \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u0430\u044f \u0441\u0431\u043e\u0440\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u0442\u0430\u043b\u0430 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u043c \u043c\u0438\u0440\u0430 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%83%D1%82%D0%B1%D0%BE%D0%BB\" title=\"\u0424\u0443\u0442\u0431\u043e\u043b\">\u0444\u0443\u0442\u0431\u043e\u043b\u0443<\/a>, \u043e\u0431\u044b\u0433\u0440\u0430\u0432 \u0432 \u0444\u0438\u043d\u0430\u043b\u0435 \u0441\u0431\u043e\u0440\u043d\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438<\/a> \u0441\u043e \u0441\u0447\u0451\u0442\u043e\u043c 3:0. \u0424\u0440\u0430\u043d\u0446\u0438\u044f \u0432\u044b\u0438\u0433\u0440\u0430\u043b\u0430 \u043d\u0430 \u0427\u041c-1998 \u0432\u0441\u0435 \u0438\u0433\u0440\u044b \u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u0442\u0438\u043b\u0430 \u043b\u0438\u0448\u044c 5 \u0433\u043e\u043b\u043e\u0432 (4 \u0438\u0437 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0441 \u043f\u0435\u043d\u0430\u043b\u044c\u0442\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1998\" class=\"mw-redirect\" title=\"1998\">1998<\/a>&#160;\u2014 \u043f\u0430\u043c\u044f\u0442\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%BD-%D0%BF%D